function App() {
  const [message, setMessage] = useState ("")

  useEffect (() => {
    fetch('/chat').then(
      res => res.json()
    ).then(
      data => {
        setData(data.message)
        console.log(data)
      }
    )
  }, [])
  return (
    <div>
      {message ? (
        <pre>{message}</pre>
      ):(
        <p>Loading...</p>
      )}

    </div>
  )
}

export default App
